/*Table structure for table `statistics2` */

DROP TABLE IF EXISTS `statistics2`;

CREATE TABLE `statistics2` (
  `stdate` date NOT NULL,
  `strace` int(3) NOT NULL,
  `stfield` varchar(40) NOT NULL default '',
  `stsignature` int(3) NOT NULL,
  `stdecision` int(2) NOT NULL,
  `stprecision` double(10,5) NOT NULL,
  `stconvergence` double(10,5) NOT NULL,
  `stfoundfirst` tinyint(1) NOT NULL,
  `stdistance` int(4) NOT NULL,
  `sthorsegender` varchar(1) NOT NULL,
  `stelements` int(2) NOT NULL,
  PRIMARY KEY  (`stdate`,`strace`,`stfield`,`stsignature`,`stdecision`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

